window.bookSummaryJSON = "<p>Six years ago, the president made the difficult decision to abandon Washington to the undead-and The Wall was built to keep them trapped inside. Now, a new presidential election revives the hopes of the nation as one candidate promises to retrieve the Declaration of Independence and Constitution from behind The Wall.</p> <p>Retired CIA operative Asher Hawke, AKA the Kestrel, agrees to lead a team to recover the national treasures. But when they insert behind The Wall, they discover that organized crime families have been stealing priceless artwork and cash as well as disposing of bodies behind The Wall.</p>"; 
